import Subscription from "../Images/subscription-2 1.svg";
import information from "../Images/change-of-student-status-information 1.svg";
import classList from "../Images/class-list 1.svg";
import routine from "../Images/Vector (1).svg";
const ApiCard = [
    {
        imgsrc: "Images/linear-online-course 1.svg",
        card_Heading : "Online Course Facilities",
        card_detail : "Access a world of knowledge from the comfort of your home with our online course facilities."
    },
    {
        imgsrc: {QR},
        card_Heading : "QR Attendance",
        card_detail : "QR attendance: Streamlined, contactless attendance tracking with QR codes."
    },
    {
        imgsrc: {Fee},
        card_Heading : "Fee Management",
        card_detail : "Efficient handling of fees and payments"
    },
    {
        imgsrc: {ID},
        card_Heading : "ID Card Generator",
        card_detail : "Create custom identification cards with ease."
    },
    {
        imgsrc: {Payment},
        card_Heading : "Payment Gateway",
        card_detail : "A payment gateway facilitates secure online transactions."
    },
    {
        imgsrc: {Subscription},
        card_Heading : "School Subscription (Saas)",
        card_detail : "Your gateway to premium educational content and services."
    },
    {
        imgsrc: {information},
        card_Heading : "Student Information",
        card_detail : "Key student data, including enrollment, contact info, and academic records."
    },
    {
        imgsrc: {classList},
        card_Heading : "Class List",
        card_detail : "A class list is a roster of names for a particular group or class"
    },
    {
        imgsrc: {routine},
        card_Heading : "Routine",
        card_detail : ""
    }
]

export default ApiCard;
